use ark_pallas::{Affine, Fq, Projective};

macro_rules! mk_aff {
    ($x:tt, $y:tt) => {
        Affine::new_unchecked(
            Fq::new_unchecked(BigInt::new($x)),
            Fq::new_unchecked(BigInt::new($y)),
        )
    };
}

macro_rules! mk_proj {
    ($x:tt, $y:tt, $z:tt) => {
        Projective::new_unchecked(
            Fq::new_unchecked(BigInt::new($x)),
            Fq::new_unchecked(BigInt::new($y)),
            Fq::new_unchecked(BigInt::new($z)),
        )
    };
}

